import React, { useEffect } from "react";
import loginImage from "./resources/images/login.png";

function Test() {
  useEffect(() => {
    const togglePassword = document.querySelector('#togglePassword');
    const password = document.querySelector('#password');

    togglePassword.addEventListener('click', () => {
      // Toggle the type attribute using
      // getAttribure() method
      const type = password.getAttribute('type') === 'password' ?
        'text' : 'password';
      password.setAttribute('type', type);
      // Toggle the eye and bi-eye icon
      togglePassword.classList.toggle('bi-eye');
    });

    // Cleanup function to remove event listener when component unmounts
    return () => {
      togglePassword.removeEventListener('click', () => {});
    };
  }, []); // Empty array ensures useEffect runs only once after component mounts

  return (
    <div className="container-fluid">
      <div className="row">
        <div
          className="col-7"
          style={{ backgroundImage: `url(${loginImage})`, height: "100vh" }}
        >
          {/* this part is left side of the division */}
        </div>
        <div className="col-5 d-flex align-items-center justify-content-center " style={{ height: "100vh" }}>
          {/* this part is right side of the division. All the login form will stay here */}
          <form action="">
            <div className="mb-3 ">
              <input type="email" className="form-control"  placeholder="Enter email"></input>
            </div>
            <div className="mb-3">
              <input type="password"className="form-control" id="password" placeholder="Enter Password" />
              <i className="bi bi-eye-slash" id="togglePassword"></i>
            </div>
            <button className="btn btn-success">Login</button>
            <p>You are agree to our terms and policies</p>
            <button className="btn btn-default border">Create account</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Test;
